import Box from "@mui/material/Box";
import {
    AppBar, Avatar,
    Button, Divider,
    IconButton,
    List,
    ListItem,
    ListItemAvatar,
    ListItemText, Paper,
    Toolbar,
    Typography
} from "@mui/material";
import * as React from "react";
import Grid from "@mui/material/Grid";
import example from "../example.json";

function NavBar(){
    return(
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News List
                    </Typography>
                    <Button color="inherit" style={{fontWeight: 'bold', fontSize: '20px'}}>←</Button>
                </Toolbar>
            </AppBar>

        </Box>
    );
}

function ListElement() {
    return(
        <>
            <ListItem alignItems="flex-start">
                <ListItemText
                    primary="Brunch this weekend?"
                    secondary={
                        <React.Fragment>
                            <Typography
                                sx={{ display: 'inline' }}
                                component="span"
                                variant="body2"
                                color="text.primary"
                            >
                                Ali Connors
                            </Typography>
                            {" <br>— I'll be in your neighborhood doing errands this…"}
                        </React.Fragment>
                    }
                />
            </ListItem>
            <Divider />
        </>
    )
}

function AlignItemsList() {
    return (
        <List sx={{bgcolor: 'background.paper' }}>
            <ListElement/>
            <ListElement/>
            <ListElement/>
            <ListElement/>
            <ListElement/>
        </List>
    );
}


function getStaticProps(){
    const data =  JSON.parse(JSON.stringify(example));
    return data;
}

export default function NewsList() {
    const data = getStaticProps();
    return (
        <>
            <NavBar/>
            <Paper sx={{margin:'30px'}}>
                <AlignItemsList/>
            </Paper>

        </>
    );
}
